import './styles.scss'
import Button from '../components/Button/Button';
import { Fragment } from 'react';
import Associates from '../containers/Home/Associates';
import Media from '../containers/Home/Media';
import Head from 'next/head';
import Router from 'next/router';
import StyledInput from '../components/Input/Input';

const Index = () => {

    return (
        <Fragment>
            <Head>
                <title>Juscredit - Home</title>
            </Head>
            <main>
                <div className="map-container">
                    <div className="map" />
                    <h1>  <br /> <img src="/antreceba.svg"/> <br /> </h1>
                    </div>
                    <p> 
                    <div className="buttons-container">
                        <Button onClick={()=> Router.push('/signup/user')} color=" transparent linear-gradient(254deg, #53B67F 0%, #086C7B 100%)">Quero participar</Button>
                        <Button onClick={()=> Router.push('/be-part')} color="primary" >Quero investir</Button>
                  
                        </div>
                        <div className="buttons-container">
                        <Button onClick={()=> Router.push('/como-funciona')} color="primary">Conheça as vantagens</Button>
        </div>
        </p>
                        <div className="lead-container">
            <h2>Seja parceiro, indique processos trabalhistas elegíveis</h2>
            <StyledInput mask={null} placeholder="Insira aqui seu e-mail" tabIndex={-1}/>
            <Button color="primary" tabIndex={-1}>Enviar</Button>

        
             </div>
  
                </main>
        
        </Fragment >
        
    );
}
export default Index;
